<!doctype html>

  <title>IcoMoon - SVG Icons</title>
  <meta charset="utf-8">

<style>
  body {
    overflow: hidden;
    overflow-y: auto;
    display: flex;
    flex-direction: column;
    padding: 3rem;
    gap: 8rem;
  }

  .mhl.ptl {
    display: grid;
    grid-template-columns: repeat(auto-fit, 5rem);
    grid-row-gap: 3rem;
    grid-column-gap: .6rem;
    align-items: center;
    justify-content: center;
  }

  .mvm.mtn.fgc1 {
    grid-column: 1 / -1;
    color: hotpink;
    background-color: #eee;
    padding: 1rem 1.6rem;
    font-family: Arial, Helvetica, sans-serif;
  }

  .glyph.fs1 {
    width: 3rem;
  }

  .pbs {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    width: 3rem;
    height: 3rem;
  }

  .icon {
    display: block;
    width: 3rem;
  }
</style>
